function SideHeader() {
  return (
    <div>
      <div style={{textAlign:"center"}}>
        <p>QUIZZIE</p>
        <p>Dashboard</p>
        <p>Analytics</p>
        <p>Create Quiz</p>
        <p>Logout</p>
      </div>
    </div>
  );
}

export default SideHeader;
